function IncrementDecrementButton({duration, disable, value, name}) {
    return (
      <button
        type="button"
        className="btn btn-primary"
        name={name}
        data-testid="decrease-focus"
        onClick={duration}
        disabled=''
        value={value}
      >
        <span className="oi oi-minus" />
      </button>
    )
}

export default IncrementDecrementButton;
